import React from "react";
import arr from "./all/50.mp4";
import "./App.css";
import ReactPlayer from "react-player";

const App = () => {
  return (
    <div className="video">
      {/* <ReactPlayer className="contain" url={arr}  loop muted playing></ReactPlayer> */}
      <video width="320" height="240" controls>
        <source src={arr} type="video/mp4" />
      </video>
    </div>
  );
};

export default App;
